import React from 'react';
import styled from 'styled-components';
import Plx from 'react-plx';
import CarInfoDisplay from './CarInfoDisplay';

const StyledSlideTwo = styled.div`
  position: relative;
  background: #FFFFFF;
  height: 100vh;
  width: 100vw;
`;

function SlideTwo() {
  const textData = [
    {
      start: '.StickyText-trigger-1',
      duration: '30vh',
      properties: [
        {
          startValue: 0,
          endValue: 30,
          unit: 'vh',
          property: 'translateY',
        },
      ],
    },
    // {
    //   start: '.StickyText-trigger-1',
    //   startOffset: '60vh',
    //   duration: '30vh',
    //   properties: [
    //     {
    //       startValue: -50,
    //       endValue: -100,
    //       unit: 'vh',
    //       property: 'translateY',
    //     },
    //     {
    //       startValue: 1,
    //       endValue: 0,
    //       property: 'opacity',
    //     },
    //   ],
    // },
  ];

  return (
    <Plx
      className='StickyText'
      parallaxData={textData}
    >
      <StyledSlideTwo>
        <CarInfoDisplay />
      </StyledSlideTwo>
    </Plx>
  );
}

export default SlideTwo;
